import React from "react";
import "./app-header.css";

const AppHeader = () => {
   return (
      <div className="app-header d-flex">
         <h1>Basir Magomedov</h1>
         <h2>5 записей, из них понравилось 0</h2>
      </div>
   );
};

export default AppHeader;
